<style>
	:root {
		--white: white;
		--lighter-orange: hsl(32, 94%, 93%);
		--lighterish-orange: hsl(32, 100%, 88%);
		--light-orange: hsl(33, 80%, 83%);
		--tan: hsl(28, 37%, 68%);
		--silver: hsl(21, 14%, 71%);
		--beaver: hsl(23, 28%, 60%);
		--cool-gray: hsl(220, 10%, 57%);
		--slate-gray: hsl(212, 16%, 50%);
		--van-dyke: hsl(14, 16%, 26%);
		--dark-silver: hsl(240, 1%, 16%);
		--raisin-black-3: hsl(223, 20%, 20%);
		--raisin-black-2: hsl(233, 11%, 15%);
		--raisin-black: hsl(223, 22%, 13%);
		--black: hsl(30, 13%, 3%);
	}

	* {
		color: var(--black);
		font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
	}

	body {
		background-color: var(--lighter-orange);

		margin: 0;
		padding: 0;
		display: grid;

		max-height: 100dvh;

		display: flex;
		flex-direction: column;
	}

	.page {
		display: flex;
		flex-direction: column;
		min-height: 100dvh;
		max-height: 100dvh;
		grid-column-start: 1;
		grid-row-start: 1;
	}

	#searchBar>* {
		color: var(--white);
		display: flex;
		flex-direction: column;
	}

	#searchInput {
		width: 100%;
		height: 8dvh;
		background-color: var(--raisin-black);

		padding: 10px;
		box-sizing: border-box;

		outline: none;
		font-size: 20px;

		border: none;
		border-bottom: 2px solid var(--dark-silver);
	}

	#resultCount {
		padding: 10px;
		font-style: italic;
		font-size: 15px;
		background-color: var(--raisin-black-2);
	}

	#searchResults {
		display: flex;
		flex-flow: column;
		overflow: auto;
	}

	.searchResult {
		display: flex;
		flex-direction: row;
		min-height: 60px;
		padding: 10px;
		align-items: center;
		overflow: hidden;

		border-bottom: 2px solid var(--silver);
		cursor: pointer;
	}

	.searchResult:hover {
		background-color: var(--lighterish-orange);
	}

	.searchResult:active {
		background-color: var(--light-orange);
	}

	.searchResult>* {
		user-select: none;
	}

	.resultLexeme {
		font-size: 22px;
	}

	.resultPreviewTranslations {
		font-size: 14px;
		color: var(--slate-gray);
	}

	.resultText {
		display: flex;
		flex-direction: column;
		width: 90%;
	}

	.resultText>* {
		text-overflow: ellipsis;
		overflow: hidden;
		padding: 5px 0;
		white-space: nowrap;
		max-width: 80dvw;
	}

	.languageFlag {
		flex: 1;
		font-size: 30px;
		text-align: center;
	}

	::placeholder {
		color: var(--silver)
	}

	button {
		outline: none;
		border: none;
		background-color: var(--raisin-black);
		color: var(--white);
	}

	button:hover {
		background-color: var(--raisin-black-2);
	}

	button:active {
		background-color: var(--raisin-black-3);
	}

	#definitions {
		flex: 1;
		overflow: auto;
	}

	#backToSearchButton {
		font-size: 32px;
		padding: 10px;
	}

	.definition {
		display: flex;
		flex-direction: column;
	}

	.wordType {
		background-color: var(--slate-gray);
		color: var(--white);
		padding: 10px;
		font-weight: bold;
		font-size: 20px;
	}

	.expression {
		background-color: var(--van-dyke);
		color: var(--white);
		padding: 10px;
		font-weight: bold;
		font-size: 20px;
	}

	.translationsBar {
		display: flex;
		flex-direction: row;
		align-items: center;
		padding: 10px;
		flex: 1;
	}

	.translations {
		max-width: 90%;
		min-width: 90%;
	}

	.translation {
		user-select: none;
		cursor: pointer;
	}

	.translation:hover {
		color: var(--raisin-black-2);
	}

	.translation:active {
		color: var(--van-dyke);
	}

	#definitionFor {
		color: var(--white);
		font-size: 30px;
		max-width: 90%;
		min-width: 90%;
	}

	#definitionForBar {
		background-color: var(--raisin-black);
		display: flex;
		flex-direction: row;
		align-items: center;
		padding: 10px;
	}

	p {
		margin: 0;
	}
</style>

function searchLexemes(arr, query) {
	const startIndex = binarySearch(arr, query);
	if (startIndex === -1) {

		return [];

	const results = [];
	for (let i = startIndex; i < arr.length; i++) {

		} else {

	}

			throw new Error(`Invalid Base64 character: ${base64String[i]}`);
		}
		number += (charCode - 32) * (64 ** i);
	}
	return number;
}

function chunkifyString(str, chunkSize) {
	const result = [];
	for (let i = 0; i < str.length; i += chunkSize) {
		result.push(str.slice(i, i + chunkSize));
	}
	return result;
}


function binarySearch(arr, query) {
	let low = 0;
	let high = arr.length - 1;

	while (low <= high) {
		const mid = Math.floor((low + high) / 2);
		const value = arr[mid];

		if (value.startsWith(query)) {
			// Move left to find the first occurrence
			if (mid === 0 || !arr[mid - 1].startsWith(query)) {
				return mid;
			}
			high = mid - 1;
		} else if (value < query) {
			low = mid + 1;
		} else {
			high = mid - 1;
		}
	}
	return -1;
}

<script>
	const MAX_RESULTS = 35;
	const EMOJI_MAP = { "ty": "üáµüá´", "en": "üá∫üá∏", "fr": "üá´üá∑" };

	let searchPage = document.getElementById("searchPage");
	let definitionPage = document.getElementById("definitionPage");

	let resultCount = document.getElementById("resultCount");

	let searchResults = document.getElementById("searchResults");
	let searchResultUis = generateSearchResultUis();

	let definitions = document.getElementById("definitions");
	let definitionFor = document.getElementById("definitionFor");
	let definitionForLanguage = document.getElementById("definitionForLanguage");

	getResults("");

	function generateSearchResultUis() {
		let content = "";
		for (let i = 0; i < MAX_RESULTS; i++) {
			content +=
				`<div class="searchResult" style="display: none;">
					<div class="resultText">
						<p class="resultLexeme"></p>
						<p class="resultPreviewTranslations"></p>
					</div>
					<p class="languageFlag"></p>
				</div>`;
		}

		searchResults.innerHTML = content;
		return searchResults.querySelectorAll(".searchResult");
	}

	function getResults(query) {
		searchResults.scrollTop = 0;

		let results = searchLexemesAllLanguages(query);
		resultCount.innerHTML = `üìù Tei 'imihia : ${results.length}`;
		results = results.slice(0, MAX_RESULTS);

		for (let i = 0; i < results.length; i++) {
			const result = results[i];
			let ui = searchResultUis[i];

			ui.onclick = () => resultPressed(result);

			ui.querySelector(".resultLexeme").textContent = LEXEME_MAP[result.language][result.index];

			let resultPreviewTranslationsUi = ui.querySelector(".resultPreviewTranslations");
			switch (result.language) {
				case "en":
				case "fr":
					let translation_indexes = TRANSLATION_INDEXES_MAP[result.language][result.index];
					let translation_lexemes = translation_indexes.map((index) => TAHITIAN_LEXEMES[index]);
					resultPreviewTranslationsUi.textContent = translation_lexemes.join(", ");
					break;
				case "ty":
					let definitions = TAHITIAN_DEFINITIONS[result.index];

					let translations = definitions.flatMap(definition => [
						...definition.englishTranslationIndexes.map((i) => ENGLISH_LEXEMES[i]),
						...definition.frenchTranslationIndexes.map((i) => FRENCH_LEXEMES[i])
					]);

					resultPreviewTranslationsUi.textContent = translations.join(", ");
					break;
			}

			ui.querySelector(".languageFlag").textContent = EMOJI_MAP[result.language];

			// Unhide
			ui.style.removeProperty("display");
		}

		for (let i = results.length; i < MAX_RESULTS; i++) {
			// Hide the remaining search result uis if there was less than MAX_RESULTS results
			let ui = searchResultUis[i];
			ui.style.display = "none";
		}
	}

	function resultPressed(searchResult) {
		searchPage.style.display = "none";
		definitionPage.style.removeProperty("display");

		wordLinkPressed(searchResult.index, searchResult.language);
	}

	function wordLinkPressed(index, language) {
		history.pushState({ page: "definition", index: index, language: language }, '');
		goToWord(index, language);
	}

	function goToWord(index, language) {
		definitions.scrollTop = 0;

		let content = "";

		definitionFor.textContent = LEXEME_MAP[language][index];
		definitionForLanguage.textContent = EMOJI_MAP[language];

		if (language == "ty") {
			for (const [definitionIndex, definition] of TAHITIAN_DEFINITIONS[index].entries()) {
				let isWordType = "wordType" in definition;
				let wordTypeOrExpression = isWordType ? definition.wordType : definition.expression;

				let englishTranslations = definition.englishTranslationIndexes.map(index => `<span class="translation" onclick="wordLinkPressed(${index}, 'en')">${ENGLISH_LEXEMES[index]}</span>`).join(', ');
				let frenchTranslations = definition.frenchTranslationIndexes.map(index => `<span class="translation" onclick="wordLinkPressed(${index}, 'fr')">${FRENCH_LEXEMES[index]}</span>`).join(', ');

				content +=
					`<div class="definition">
						<p class="${isWordType ? "wordType" : "expression"}">${isWordType ? (definitionIndex + 1).toString() + ")" : "expr:"} ${wordTypeOrExpression}</p>
						<div class="translationsBar">
							<p class="translations">${englishTranslations}</p>
							<p class="languageFlag">üá∫üá∏</p>
						</div>
						<div class="translationsBar">
							<p class="translations">${frenchTranslations}</p>
							<p class="languageFlag">üá´üá∑</p>
						</div>
					</div>`;
			}
		} else {
			let translation_indexes = TRANSLATION_INDEXES_MAP[language];
			let translations = translation_indexes[index].map((translation_index) => `<span class="translation" onclick="wordLinkPressed(${translation_index}, 'ty')">${TAHITIAN_LEXEMES[translation_index]}</span>`).join(", ");

			content +=
				`<div class="translationsBar">
					<p class="translations">${translations}</p>
					<p class="languageFlag">üáµüá´</p>
				</div>`;
		}

		definitions.innerHTML = content;
	}

	function backToSearchButtonPressed() {
		history.pushState({ page: "search" }, '');
		searchPage.style.removeProperty("display");
		definitionPage.style.display = "none";
	}


	// Add an initial state to the history
	history.replaceState({ page: "search" }, '');

	// Function to handle back button press
	window.onpopstate = function (event) {
		const state = event.state;

		if (state && state.page) {
			switch (event.state.page) {
				case "search":
					searchPage.style.removeProperty("display");
					definitionPage.style.display = "none";
					break;
				case "definition":
					searchPage.style.display = "none";
					definitionPage.style.removeProperty("display");

					goToWord(state.index, state.language);
					break;
			}
		} else {
			// Default action if there's no custom state
			history.back();
		}
	};

</script>
